import React, { Component } from 'react'
import Home from '../pages/home'
//API URL
const url = 'http://localhost:3000/';

export default class Body extends Component {
    state = {
        data:[]
    };
    
    componentDidMount(){
      
        fetch(url +'attendance/getRecent/30')
        .then(response=>{
            return response.json();
        })
        .then(json=>{
            this.setState({
                data:json
            })
        })
    }
    render() {
        return (
           <HomePage/>
        )
    }
}
